import React from "react";
import { createGlobalStyle } from "styled-components";

const GlobalStyle = createGlobalStyle`
  body { 
     margin: 0;
     padding: 0;
     box-sizing: border-box;
  }
`;

import Header from "./elements/Header";
import Home from "./Home";

const App = () => (
  <div>
    <Header />
    <Home />
  </div>
);

export default App;
